import React from 'react'
import FoodItem from './FoodItem'

const MenuItem = ({menuItem}) => {
    return (
        <div>
            <h3>{menuItem.category}</h3>
            <div>
                {menuItem.foods.map((food) => (
                    <FoodItem
                        food={food}
                    />   
                ))}
            </div>
        </div>
    )
}

export default MenuItem
